  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:42.632164\",\n\t\"name\": \"usfws-guide-use-areas-within-alaskas-national-wildlife-refuges-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The United States Fish and Wildlife Service,
  Region 7 (Alaska) has established Guide Use Areas (GUA) within the National Wildlife
  Refuges in the state of Alaska. The GUAs are discreet geographic areas in which
  USFWS-permitted commercial hunting guides can conduct hunting, fishing, and guiding
  activities for commercial purposes.Guide Use Areas are administrative boundaries,
  meaning that they are not defined by a specific legal description codified in law.
  Rather, the boundaries of each GUA were established by personnel of the U.S. Fish
  & Wildlife Service, based on various Refuge management criteria and needs. As such,
  the boundaries may be adjusted from time to time to conform to changing Refuge management
  missions and goals.nnThe maps contained in this mapbook were created on March 21,
  2014. National Wildlife Refuge boundaries and Guide Use Area boundaries are current
  to March 21, 2014. Land ownership boundaries within the National Wildlife Refuges
  were obtained from the USFWS Region 7, Division of Realty master land ownership
  GIS database. Land ownership is current to March 21, 2014.\",\n\t\"license_title\":
